//import from './logo.svg';
import React, {Component} from 'react';
import './App.css';
import Header from './Header';
import Home from './Home';
import { BrowserRouter, Routes, Route, Router } from 'react-router-dom';
import Checkout from './Checkout';

function App() {
  return (
    <div className="App">
      <Router>
        <Route path="/checkout">
          <Header />
          <Checkout />
        </Route>
        <Route path="/">
          <Header />
          <Home />
        </Route>
      </Router>
    </div>
  )
}

export default App;
